 - Msx 2 gene regulatory program is upregulated in association with vascular calcification . We verified the procalcific actions of aortic Msx 2 expression in vivo . CMV-Msx 2 transgenic ( CMV-Msx 2Tg ( + ) ) mice expressed 3 - fold higher levels of aortic Msx 2 than nontransgenic littermates . On high-fat diets , CMV-Msx 2Tg ( + ) mice exhibited marked cardiovascular calcification involving aortic and coronary tunica media . This corresponded to regions of Msx 2 immunoreactivity in adjacent adventitial myofibroblasts , suggesting a potential paracrine osteogenic signal . To better understand Msx 2 - regulated calcification , we studied actions in 10T1 / 2 cells . We found that conditioned media from Msx 2 - transduced 10T1 / 2 cells ( Msx 2 - CM ) is both pro-osteogenic and adipostatic ; these features are characteristic of Wnt signaling . Msx 2 - CM stimulated Wnt-dependent TCF / LEF transcription , and Msx 2 - transduced cells exhibited increased nuclear beta-catenin localization with concomitant alkaline phosphatase induction . Msx 2 upregulated Wnt 3a and Wnt 7a but downregulated expression of the canonical inhibitor Dkk 1 . Dkk 1 treatment reversed osteogenic and adipostatic actions of Msx 2 .

 , in this disease . We now demonstrate that the myelosuppressive cytokines TNFalpha and IL - 1beta are secreted by bone marrow ( BM ) cells in a p38 MAPK-dependent manner . Their secretion is stimulated by paracrine interactions between BM stromal and mononuclear cells and cytokine induction correlates with

 + stem cell apoptosis in an inflammation-simulated in vitro bone marrow microenvironment . Treatment with

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">F-actin involvement in guinea pig sperm motility . Sperm motility is a must for natural fertilization to occur . During their travel through the epididymis , mammalian spermatozoa gradually acquire the ability to move . This is accomplished through a sliding movement of the outer doublet microtubules of the axoneme which is energized by the dynein ATPase . Within its complex structure , the mammalian sperm flagellum contains F-actin and thus , we decided to test in the guinea pig sperm flagellum the role of F-actin in motility . During maturation , capacitation , and the acrosome reaction , a gradual decrease of the relative concentration of F-actin was observed . Motility increased as spermatozoa became able to fertilize . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06396
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , phalloidin , and KI inhibited sperm motility . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06396
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 canceled sperm motility within 20 min of treatment while 0.6 M KI had immediate effects . Phalloidin diminished hyperactive sperm motility slightly . All three compounds significantly increased the relative concentration of F-actin . Latrunculins are conventional drugs that destabilize the F-actin cytoskeleton . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02621

</mark>
 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O43561
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 A ) did not affect sperm motility ; but significantly increased F-actin relative concentration . The results suggested that in guinea pig spermatozoa , randomly severing F-actin filaments inhibits flagellar motility ; while end filament alteration does not . Thus , specific filament regions seem to be important for sperm motility .</div>

 ( Ki , 0.5 nM ) receptors , the pharmacodynamic profile of lurasidone is notable for its high affinity for serotonin

 . None of the other mutations differed significantly from NR1A itself except S617N , which displayed a 6 - fold reduction in Mg2 + block . A well-barrier model of permeation through the DB01221 receptor channel is presented that quantitatively reproduces voltage-dependent Mg2 + block . This model demonstrates that only minimum changes energy profiles experienced by permeating ions , equivalent to the energy of a single hydrogen or ionic bond , are required to abolish Mg2 + block . These findings indicate that only small structural changes are needed to convert a Mg ( 2 + ) - insensitive ion channel to a channel with pronounced voltage-dependent Mg2 + block .</div>
